    {
      id: 1,
      title: 'Estudar',
      completed: false
    },
    {
      id: 2,
      title: 'Corre',
      completed: true
    }
  ]);

  return (
    <>
      <div className="container">
        < Task myTasks={tasks} />
      </div>
    </>
  );
};

export default App;
